FeedPackage.Description:
It's an extension for the [RSSDP library](https://github.com/Yortw/RSSDP) (the implementation of the ssdp protocol)
It is not a complete implementation of the UPNP;
In which cases you can use it: - If you want to publish a description of your device on the Http server - If you want to publish devices on specified networks - If you want to search devices on specified networks - Not all upnp devices send 'byebye' notification to the network, you can activate the monitoring mode to check availability of device description

